Enabling Oracle AQ in an Amazon RDS database requires some specific configuration steps. Here are the general steps you can follow:

1. Make sure your RDS instance is running Oracle database version 12.2 or later, since AQ is not available in earlier versions.
2. Enable the AQ feature in your RDS instance by running the following command as a user with DBA privileges:
```sql
ALTER SYSTEM SET aq_tm_processes=<number of AQ processes> SCOPE=BOTH;
```
Replace `<number of AQ processes>` with the number of AQ processes you want to enable. The default is 1, but you may want to increase this depending on your workload.
3. Create a table to hold the messages that will be sent and received by AQ. For example:
```sql
CREATE TABLE myqueue (id NUMBER PRIMARY KEY, message VARCHAR2(4000));
```
4. Create an AQ queue and a corresponding queue table using the following commands:
```javascript
EXECUTE DBMS_AQADM.CREATE_QUEUE(queue_name => 'myqueue', queue_table => 'myqueue_table');
EXECUTE DBMS_AQADM.START_QUEUE(queue_name => 'myqueue');
```
5. Once the queue is created, you can start sending and receiving messages using the `DBMS_AQ` package. For example, to enqueue a message:
```javascript
DECLARE
   enqueue_options     DBMS_AQ.ENQUEUE_OPTIONS_T;
   message_properties DBMS_AQ.MESSAGE_PROPERTIES_T;
   message_handle      RAW(16);
BEGIN
   DBMS_AQ.ENQUEUE(queue_name => 'myqueue',
                   enqueue_options => enqueue_options,
                   message_properties => message_properties,
                   payload => 'Hello, world!',
                   msgid => message_handle);
   COMMIT;
END;
```

These are just general steps, and the specific commands you need to run may depend on your application requirements. It's also worth noting that Amazon RDS does not provide direct access to the underlying operating system, so some configuration tasks that would be straightforward in a traditional Oracle installation may be more challenging in an RDS environment.

