Here's an updated implementation of the middleware that checks all restrictions in `client.restrictions`:
```python
from django.shortcuts import HttpResponse
class ClientMiddleware:
    RULE_SETS = {
        "agency_in_allow_list": "agency",
        "network_in_allow_list": "network",
    }

    def __init__(self, get_response):
        self.get_response = get_response

    def __call__(self, request):
        # Only apply middleware to URL's nested to clients/{client_id}/*
        if 'client_id' not in request.resolver_match.kwargs:
            return self.get_response(request)

        client_id = request.resolver_match.kwargs['client_id']
        try:
            client = Client.objects.get(id=client_id)
        except Client.DoesNotExist:
            return HttpResponse("Client not found", status=404)

        user_permission = ClientUserPermission.objects.filter(client_id=client_id, user=request.user).first()
        if user_permission is None or user_permission.permission == "block":
            return HttpResponse("Access blocked by client", status=403)

        user_type = request.user.type

        if not client.restrictions:
            return self.get_response(request)

        rule_set_keys = [k for k in self.RULE_SETS if k in client.restrictions]
        rule_set_values = [self.RULE_SETS.get(k, None) for k in rule_set_keys]
        if all([value == user_type for value in rule_set_values]) and user_permission.permission == "allow":
            return self.get_response(request)

        # All conditions failed, return access denied
        return HttpResponse("Access denied by client restrictions", status=403)
```
In this implementation, we use a list comprehension to retrieve all rule set keys that are present in the `client.restrictions` set. We then use another list comprehension to retrieve the corresponding rule set values for these keys.

We then use the built-in `all` function to check if all values in `rule_set_values` match the user type. If they do, we proceed to check the client-user permission, as before. If the permission is "allow", we return the response from the next middleware or view function in the chain. If any of the conditions fail, we return a "Access denied by client restrictions" error response.

